header('Content-Type: text/html; charset=utf-8');

// Function to get current server time and convert it to GMT
function getCurrentTime() {
    // Set the default timezone to the server's timezone
    date_default_timezone_set('America/New_York'); // Change this to your server's timezone

    // Get the current server time
    $serverTime = new DateTime();
    
    // Set the timezone to GMT (UTC)
    $serverTime->setTimezone(new DateTimeZone('GMT'));
    
    // Format the time as desired
    $localTime = date('Y-m-d H:i:s');
    $gmtTime = $serverTime->format('Y-m-d H:i:s');

    return [
        'local' => $localTime,
        'gmt' => $gmtTime
    ];
}

// Get the current time initially
$currentTime = getCurrentTime();


