        .container {
            display: flex;
            flex-direction: column;
            flex: 1;
            width: 100%;
        }

        .large {
            flex: 2; /* Takes up more space */
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 2em;
            border-radius: 10px;
        }
        
        .squarex {
            flex: 2;
            background-color: #0003298c;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 1em;
            border-radius: 10px;
            margin: 5px;
            height: 98%;
        }
          
        .grid {
            display: flex;
            flex: 1;

        }

        .square {
            flex: 1;
            background-color: #95188e36;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 1.5em;
            margin: 5px; /* Spacing between squares */
            border-radius: 10px;
}
